import theme from "../styles/theme";

const Contact = () => (
  <>
    <section className="contact">
      <div>
        <h1 className="title">Any questions or comments?</h1>
        <p className="body">Send your inquiries below</p>
      </div>
      <button className="btn">Let's talk!</button>
    </section>
    <style jsx>
      {`
        .contact {
          display: flex;
          margin-top: 25%;
          margin-bottom: 20%;
          padding-left: 15%;
        }
        .title {
          color: white;
          font-size: 30px;
          margin-bottom: 5px;
          text-shadow: -1px -1px ${theme.colors["pink"]},
            -2px -2px ${theme.colors["pink"]}, -3px -3px ${theme.colors["pink"]},
            -4px -4px ${theme.colors["pink"]}, -5px -5px ${theme.colors["pink"]},
            -6px -6px ${theme.colors["pink"]}, -7px -7px ${theme.colors["pink"]},
            -8px -8px ${theme.colors["pink"]}, -9px -9px ${theme.colors["pink"]};
        }
        .body {
        }
        .btn {
          font-size: 15px;
          padding: 10px;
          margin-top: 50px;
        }
      `}
    </style>
  </>
);

export default Contact;
